INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0, 1, 122601, 101, 160, 105, 1, 0, 1, 1.5, 1, 0.029);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 1, 2, 122401, 102, 120, 111, 2, 0, 0, 2.5, 3, 0.014);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0, 3, 122501, 103, 350, 105, 3, 1, 0, 2.5, 2, 0.017);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 1, 4, 107501, 104, 130, 105, 4, 0, 0, 1.5, 3, 0.016);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0, 5, 107601, 105, 160, 105, 5, 0, 1, 2.5, 1, 0.014);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (120, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0, 6, 107801, 106, 255, 103, 6, 1, 0, 3.5, 2, 0.029);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (120, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0, 7, 110601, 107, 160, 103, 7, 0, 1, 3.5, 1, 0.013);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0, 8, 110401, 108, 350, 103, 8, 1, 0, 2.5, 2, 0.014);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 1, 9, 110501, 109, 130, 100, 9, 0, 0, 1.5, 3, 0.012);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0, 10, 115701, 110, 200, 103, 10, 0, 1, 2.5, 1, 0.014);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0, 11, 113601, 111, 350, 103, 11, 1, 0, 2.5, 2, 0.071);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (120, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 1, 12, 107901, 112, 130, 103, 12, 0, 0, 1.5, 3, 0.014);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0, 13, 108001, 113, 200, 105, 13, 0, 1, 1.5, 2, 0.022);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0, 14, 110301, 114, 160, 108, 14, 0, 1, 2.5, 1, 0.031);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 1, 15, 107701, 115, 130, 105, 15, 0, 0, 0.5, 1, 0.036);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0, 16, 113101, 116, 350, 95, 16, 1, 0, 3.5, 2, 0.048);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 1, 17, 113301, 117, 130, 105, 17, 0, 0, 1.5, 3, 0.043);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 1, 18, 113201, 118, 130, 95, 18, 0, 0, 1.5, 2, 0.018);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0, 19, 117001, 119, 160, 108, 19, 0, 1, 2.5, 2, 0.021);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0, 20, 113501, 120, 255, 105, 20, 1, 0, 2.5, 1, 0.036);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0, 21, 113401, 121, 350, 105, 21, 1, 0, 2.5, 3, 0.02);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 1, 22, 110101, 122, 130, 105, 22, 0, 0, 2.5, 1, 0.018);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0, 23, 110001, 123, 160, 111, 23, 0, 1, 3.5, 3, 0.03);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 1, 24, 117201, 124, 130, 103, 24, 0, 0, 1.5, 1, 0.027);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0, 25, 117301, 125, 160, 108, 25, 0, 1, 3.5, 2, 0.02);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0, 26, 117401, 126, 350, 105, 26, 1, 0, 2.5, 3, 0.04);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0, 27, 117101, 127, 350, 105, 27, 1, 0, 3.5, 1, 0.009);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (120, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0, 28, 122901, 128, 255, 105, 28, 1, 0, 3.5, 1, 0.022);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (110, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 1, 29, 122801, 129, 130, 105, 29, 0, 0, 2.5, 3, 0.028);
INSERT INTO `v1_0325acbf45733a684c7173849552a7211e3f691993a26a97cab1bfeac0541605` VALUES (105, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0, 30, 122701, 130, 130, 108, 30, 0, 1, 3.5, 2, 0.023);
